import {useState} from 'react';
import './App.css';
import CanvasDraw from 'react-canvas-draw';

function App() {
  const[state, setState] = useState({
    onChange: null,
    loadTimeOffset: 5,
    lazyRadius: 30,
    brushRadius: 4,
    brushColor: "#444",
    catenaryColor: "#0a0302",
    gridColor: "rgba(150,150,150,0.17)",
    hideGrid: true,
    canvasWidth: 280,
    canvasHeight: 280,
    disabled: false,
    imgSrc: "",
    saveData: null,
    immediateLoading: false,
    hideInterface: false
  });

  return (
    <div className="container">
      <div className="canvas">
        <CanvasDraw {...state}/>
      </div>
      <button>
        Reset
      </button>
    </div>
  );
}

export default App;
